        biz_id: str = None,
        certification_id: str = None,
        chain_id: str = None,
        country_code: str = None,
        description: str = None,
        id_number: str = None,
        id_type: int = None,
        image: str = None,
        memo: str = None,
        email: str = None,
        phone_number: str = None,
        product_code: str = None,
